import React from "react";
import './App.scss';
import {connect} from "react-redux";

class ArticleListComponent extends React.Component {
    constructor(props) {
        super ( props );
    }

    render() {
        return (
            <div className={"article"}>
                {this.props.name}
                {this.props.color}
                {this.props.price}
                {this.props.imgUrl}
            </div>)
    }
}

const mapStateToProps = (state) => {
    return ({
        men : state ? state.men : '' ,
        women : state ? state.women : '' ,
    });
};
export const ArticleList= connect ( mapStateToProps) ( ArticleListComponent );
